import React from "react";
import NavTop from "./NavTop";
import Footer from "./Footer";
import Skills from "./Skills";
import Resume from "./Resume";

function Home() {
  return (
    <div>
      <NavTop />
      <Skills />
      <Resume />
      <Footer />
    </div>
  );
}

export default Home;
